import './Card.css';
const Card = ({ title, description, image}) =>{
    return(
        <div className="card">
            {image && <img src={image} alt={title} className="card-img" />}
            <div className="card-body">
                <h2>{title}</h2>
                <p>{description}</p>
            </div>
        </div>
    );
}

export default Card;
